import React, { Component } from "react";
import "./Forum.css";

class Forum extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="forum-container">
          <img src="./Banner.jpg"/>
        <div className="hero-text">
          <h1>Forums</h1>
          <p>
            WastedPonetial is a forums for students to clarify their doubts with
            other students
          </p>
          <button>Go to Forum</button>
        </div>
      </div>
    );
  }
}

export default Forum;
